import './App.css';
import { Routes, Route } from 'react-router-dom';
import MainPage from './pages/MainPage/MainPage'

function App() {
  return (
    <div className="App">
<Routes>
  <Route path='/' element={<MainPage />}/>
  <Route path='/categories' element={<AllCaregoriesPage />}/>
</Routes>
    </div>
  );
}

export default App;
